import React, { Component } from "react";
class RepoInfo extends Component {
  constructor(props) {
    super(props);
    this.state = { repos: [] };
    this.handleclick = this.handleclick.bind(this);
  }
  render() {
    return <div>mayank</div>;
  }
}

export default RepoInfo;
